var isToggleEnabled = true;
$(window).load(function () {
        var status = sessionStorage.getItem('duqstate-' + window.location.href);
        if (status == null) {
            if (page_name == "master_course_clp") {
                $('.drop_box_enqr').hide();
                $('.drop_box_enqr').addClass("redShow");
                toggleDropUsQueryNew();
                $('.drop_box_enqr').show();
                sessionStorage.setItem('duqstate-' + window.location.href, 2);
            } else {
                setTimeout(function () {
                    $('.drop_box_enqr').addClass("redShow");
                    sessionStorage.setItem('duqstate-' + window.location.href, 1);
                }, 30000);
            }
            triggerGAForDUQNew("Window_Opened_Auto");
        } else if (status == 2) {
            $('.drop_box_enqr').hide();
            $('.drop_box_enqr').addClass("redShow");
            toggleDropUsQueryNew();
            $('.drop_box_enqr').show();
        } else {
            $('.drop_box_enqr').hide();
            $('.drop_box_enqr').addClass("redShow");
            $('.drop_box_enqr').show();
        }
});
var isStartedTypingDUQ = false;
$(document).ready(function () {
    $(".duq-new-head").click(function () {
        if (isToggleEnabled) {
            toggleDropUsQueryNew();
        }
    });
    $("#new-duq-form").on('submit', function (event) {
        event.preventDefault();
        processDropusQuery();
    });
    $("#new-duq-form input[type=text], #new-duq-form .new-duq-query-in").keydown(function() {
        if (!isStartedTypingDUQ) {
            isStartedTypingDUQ = true;
            triggerGAForDUQNew("Started_Typing");
        }
    });
});

function toggleDropUsQueryNew() {
    $(".form_drp").slideToggle(300, "swing", function() {
        isToggleEnabled = true;
    });
    $(".dp_hd_bx").toggleClass("totop");
    if($(".dp_hd_bx").hasClass("totop")) {
        triggerGAForDUQNew("Closed_Window");
        sessionStorage.setItem('duqstate-' + window.location.href, 2);
    } else {
        triggerGAForDUQNew("Clicked_On_Drop_Us_Query");
        $(".tnk-duq-bx").hide();
        $("#new-duq-form").show();
        sessionStorage.setItem('duqstate-' + window.location.href, 1);
    }
}

function processDropusQuery() {
    if(validateDropusQuery()) {
        isStartedTypingDUQ = false;
        triggerGAForDUQNew("Successful_Submission");
        var selCode = $("#mobile_country_code").val();
        $("#new-duq-form").find('.newdropusquerycode').val(selCode);
        doDropusQueryRestCall();
    }
}

function doDropusQueryRestCall() {
    $('#ajax-loader').show();
    $.ajax({
        url: webURL + 'pages/feedback',
        data: $("#new-duq-form").serialize(),
        type: 'POST',
        dataType: 'json',
        error: function () {
            $('#ajax-loader').hide();
        },
        success: function (data) {
            var email = $("#new-duq-form").find('.new-duq-email-in').val().trim();
            var mobile = $("#new-duq-form").find('.new-duq-mobile-in').val().trim();
            var countryCode = $("#new-duq-form").find('.newdropusquerycode').val();
            var userFormData = {email:email, phone:mobile, country_code:countryCode};
            setUserInfoInStorage(userFormData);
            handleDUQResponse(data);
            $('#ajax-loader').hide();
        }
    });
}

function handleDUQResponse(data) {
    if (data.status === "thankyou" || data.status === "lead" || data.status === "success") {
        $("#new-duq-form").hide();
        $(".tnk-duq-bx").show();
        isToggleEnabled = false;
        setTimeout(function() {
            triggerGAForDUQNew("Thank_You_Message_Shown");
            toggleDropUsQueryNew();
        }, 2000);
    }
}

function validateDropusQuery() {
    var isValid = true;
    var emailRegex = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    var email = $("#new-duq-form").find('.new-duq-email-in').val().trim();
    var mobile = $("#new-duq-form").find('.new-duq-mobile-in').val().trim();
    var query = $("#new-duq-form").find('.new-duq-query-in').val().trim();
    
    if (emptyCheck(email)) {
        isValid = false;
        triggerGAForDUQNew("Error_Message", "Email");
        addErrorToInput($("#new-duq-form").find('.new-duq-email-in'),"Please enter the email");
    } else if (!emailRegex.test(email)) {
        isValid = false;
        triggerGAForDUQNew("Error_Message", "Email");
        addErrorToInput($("#new-duq-form").find('.new-duq-email-in'),"Please enter the valid email");
    } else {
        removeErrorFromInput($("#new-duq-form").find('.new-duq-email-in'));
    }
    
    if (emptyCheck(mobile)) {
        isValid = false;
        triggerGAForDUQNew("Error_Message", "MobileNo");
        addErrorToInput($("#new-duq-form").find('.new-duq-mobile-in'),"Please enter the mobile no");
    } 
    var validateMoblie = validatePhoneCustomClass($("#new-duq-form").find(".new-duq-mobile-in"));
    if (validateMoblie.valid) {
        removeErrorFromInput($("#new-duq-form").find('.new-duq-mobile-in'));
    } else {
        isValid = false;
        triggerGAForDUQNew("Error_Message", "MobileNo");
        addErrorToInput($("#new-duq-form").find('.new-duq-mobile-in'), validateMoblie.message);
    }
    
    if (emptyCheck(query)) {
        isValid = false;
        triggerGAForDUQNew("Error_Message", "Query");
        addErrorToInput($("#new-duq-form").find('.new-duq-query-in'),"Please enter the query");
    } else {
        removeErrorFromInput($("#new-duq-form").find('.new-duq-query-in'));
    }
    
    return isValid;
}

function addErrorToInput(element, message) {
    element.closest(".errormsg").html(message);
    element.closest(".inputfld").addClass('error');
    element.closest(".errormsg").show();
}

function removeErrorFromInput(element) {
    element.closest(".errormsg").html("");
    element.closest(".inputfld").removeClass('error');
    element.closest(".errormsg").hide();
}

$(document).ready(function () {

    $(".tc_agree").click(
            function (event) {
                if ($(this).prop("checked")) {
                    $(".sg_submit").removeAttr("disabled");
                } else {
                    $(".sg_submit").attr("disabled", "disabled");
                }
            }
    );

    $("#enrollModalcenter").on("hidden.bs.modal", function () {
        formOpened = false;
        resetForms($(this));
    });
    $('#exitpop_mode').on('shown.bs.modal', function () {
        $('#enrollModalcenter').modal('hide');
        $('#new_sign_up_mode').modal('hide');
        $('#gettopfoldclp').modal('hide');
        $('#letusknowmodal').modal('hide');
        $('#emailcertificate').modal('hide');
    });

    $('#enrollModalcenter').on('shown.bs.modal', function () {
        $('.user_em_bx').focus();
        $('.user_em_bx').attr("placeholder", "e.g. zoe@gmail.com");
    });

    $(".show-vd_pw").click(function () {
        resetForms($(this));
        $(".show-vd_pw").addClass('hide');
        $(".hide-vd_pw").removeClass('hide');
        //event.stopPropagation();
        $(this).closest('.modal-body').find(".pwd2_new").attr("type", "text");
    });
    
    $(".hide-vd_pw").click(function () {
        resetForms($(this));
        $(".hide-vd_pw").addClass('hide');
        $(".show-vd_pw").removeClass('hide');
        $(this).closest('.modal-body').find(".pwd2_new").attr("type", "password");
        //event.stopPropagation();
    });
	
});

