function formatPrice(price) {
    const figure = 3;
    if (price !== undefined && price != null) {
        price = price.toString();
        if (price.length > figure) {
            price = price.slice(0, price.length - figure) + "," + price.slice(price.length - figure);
        }
    }
    return price;
}

