$(document).ready(function () {
    //Notifications-start
	if(isloggedIn != ""){
    $(".dropdown-menu-scrollbar").mCustomScrollbar({
        theme: "minimal-dark",
        mouseWheel: {preventDefault: true}
    });

    $(".dropdown-menu-scrollbar, html").on("mouseup pointerup", function (e) {
        $(".dropdown-menu-scrollbar .mCSB_scrollTools").removeClass("mCSB_scrollTools_onDrag");
    }).on("click", function (e) {
        if ($(e.target).parents(".mCSB_scrollTools").length || $(".dropdown-menu-scrollbar .mCSB_scrollTools").hasClass("mCSB_scrollTools_onDrag")) {
            e.stopPropagation();
        }
    });

    $("#header-II .search-nav .dropdown-menu > li:first-child").addClass("active");
    $("#header-II .search-nav .dropdown-menu > li").hover(function (e) {
        $("#header-II .search-nav .dropdown-menu > li").removeClass("active");
        $(this).toggleClass("active");
    });
    if ($(window).width() < 991) {
        $("#header-II .search-nav .dropdown-menu > li:first-child").removeClass("active");
    }
    //Notifications-end

    $('.notifydrop').on('click', '.open-notifications.markasread', function () {
        var clickedElement = this;
        if ($(this).attr('aria-expanded') !== 'true')
            readNotifications(clickedElement, 2);
    });
    $('.notifydrop').on('click', '.notification-read', readNotifications);
    $('.notifydrop').on('click', '#notifications-view-all', readNotifications);
    $('#notifications-show-more').on('click', function () {
        loadNotifications();

        return false;
    });

    /*
     * handle pop up notiification for subit feedback course
     */
    $('body').on('submit', ".class-feedback-form", function () {
        $('#ajax-loader').show();
        $.ajax({
            type: "POST",
            url: webURL + "lms_courses/submitCourseFeedback",
            data: $("#class-feedback-form").serialize(), // serializes the form's elements.
            success: function (data)
            {
                $('#ajax-loader').hide();
                var nn_id = $("#nn_id").val();
                $('#notification-read-wrapper' + nn_id).remove();
                $('#class-feedback').modal('hide');
                $('#class-feedback').remove();

            }
        });
        return false;
    });
    loadNotifications(true);
	}
});
function readNotifications(clickedElement, accessType) {
    if (!$(clickedElement).hasClass('open-notifications'))
        var clickedElement = $(this);

    var asyncRequest = false;
    var notifications = new Array();
    var accessType = '2';

    if ($(clickedElement).hasClass('notification-read')) {
        notifications.push(clickedElement.data('id'));
        accessType = '3';
    } else if ($(clickedElement).hasClass('open-notifications')) {
        notifications = $('#notificationsWrapper').data('notifications');
        asyncRequest = true;
    } else {
        notifications = $('#notificationsWrapper').data('notifications');
    }
    var loadedcontent = $('#notificationsWrapper').data();

    if (typeof accessType == 'undefined') {
        accessType = '2';
    }
    var url = $('#notificationsWrapper').data('view-url');
    loadedcontent.notifications = notifications;
    loadedcontent.action = accessType;

    $.ajax({
        url: url,
        data: loadedcontent,
        type: 'POST',
        async: asyncRequest,
        success: function (responce) {
            if (typeof responce != 'object') {
                console.log('error retriving notification');
                return false;
            }
            if (responce.data.status == 200) {
                if (responce.data.unreadcount <= 0) {
                    $('.notificationcount-blank').show();
                    $('.notificationcount').hide();
                    $('#notifications-view-all').addClass('hide');
                } else {
                    $('#notifications-view-all').removeClass('hide');
                    $('.notificationcount').show();
                    $('.notificationcount-blank').hide();
                }
                $('.notification-count').html(responce.data.unreadcount);
                if ($(clickedElement).hasClass('notification-read')) {
                    $(clickedElement).addClass('viewed');
                    renderNotification(clickedElement);
                } else if ($(clickedElement).hasClass('open-notifications')) {
                    $(clickedElement).children('li.notification-read').addClass('viewed');
                    return true;
                } else {
                    $('li.notification-read').addClass('viewed');
                    renderNotification(clickedElement);
                }
            }
        }
    });
    return false;

}

function renderNotification(clickedElement) {
    var outputtype = $(clickedElement).data('outputtype');
    if (outputtype == 'popup') {
        var postData = $(clickedElement).data('params');
        $.ajax({
            url: webURL + 'rendernotification',
            data: postData,
            type: 'POST',
            async: false,
            success: function (response) {
                console.log(isJSON(response));
                if (isJSON(response)) {
                } else {
                    $('#popupnotificationwrapper').html(response);
                    $('#' + postData.target).modal('show');
                }
            }
        });

    } else {
        if ($(clickedElement).children('a').attr('target') === '_blank') {
            window.open(clickedElement.children('a').attr('href'));
        } else {
            window.location = clickedElement.children('a').attr('href');
        }
    }
}
function loadNotifications(forceload) {
    if ($("#notificationsWrapper").length == 0) {
        return false;
    }
    if (typeof forceload == 'undefined')
        forceload = false;
    var loadedcontent = $('#notificationsWrapper').data();
    var url = $('#notificationsWrapper').data('url');
    loadedcontent.page = loadedcontent.page + 1;
    loadedcontent.auto = forceload;
    var loadedNotifications = loadedcontent.notifications ? loadedcontent.notifications : new Array();
    $.ajax({
        url: url,
        data: loadedcontent,
        type: 'POST',
        success: function (responce) {
            //responce = JSON.parse('{"data":{"status":200,"count":4,"unreadcount":1,"notifications":[{"id":"122543","url":"http://www.dev-edureka.co/communities/question/80210-test-ts-gfd-gdfgfd","api_params":{"moderation_status":"acknowledgment","post_id":"80210"},"description":"Thanks for your question; we will review and get back to you shortly.","outputtype":null,"target":null,"timestamp":1452860978,"time":"2 weeks ago","status":true}]}}');
            if (typeof responce != 'object') {
                console.log('error retriving notification');
                return false;
            }
            if (responce.data.status == 200) {
                if (responce.data.unreadcount <= 0)
                {
                    $('.notificationcount-blank').show();
                    $('.notificationcount').hide();
                    $('#notifications-view-all').addClass('hide');
                } else
                {
                    $('.notificationcount').show();
                }

                $('.notification-count').html(responce.data.unreadcount);
                if (typeof responce.data.notifications == 'object' && (responce.data.notifications).length > 0) {

                    $.each(responce.data.notifications, function (index, notification) {
                        var target = "";
                        var redirectUrl = 'javascript:void(0);';
                        var onclick = " ";
                        if (!(notification.url == null) && (notification.url).toLowerCase().indexOf("<url>") >= 0)
                        {
                            onclick = '   onclick="openReferPopup()"';
                        } else if (!(notification.url == null) && (notification.url).toLowerCase().indexOf("edureka") < 0 && (notification.url).toLowerCase().indexOf("http") === 0)
                        {
                            redirectUrl = notification.url;
                            target = ' target="_blank"';
                        } else if (!(notification.url == null)) {
                            redirectUrl = notification.url;
                        }
                        /*var notificationElement = '<a ' + onclick + target + ' href="' + redirectUrl + '" class="notification-read" data-id="' +
                         notification.id + '" data-outputtype="' + notification.outputtype + '"  data-target="' + notification.target +
                         '" id="notification-read-wrapper' + notification.id + '"><li class="notification-element' + (notification.status >= 1 ? ' viewed' : '') +
                         '" data-time="' + notification.timestamp + '"><span>' + notification.description + '</span><br><small>' +
                         notification.time + '</small></li></a>';*/
                        var notificationElement = '<li class="notification-read' + (notification.status >= 1 ? ' viewed' : '') +
                                '" data-id="' +
                                notification.id + '" data-outputtype="' + notification.outputtype + '" data-time="' + notification.timestamp + '" id="notification-read-wrapper' + notification.id + '"><a ' + onclick + target + ' href="' + redirectUrl + '"  data-target="' + notification.target +
                                '"><span class="notification-element-two"><span>' + notification.description + '</span><br><small>' +
                                notification.time + '</small></span></a></li>';
                        insertNotification(notification.timestamp, notificationElement);
                        if (notification.outputtype == 'popup')
                            $('#notification-read-wrapper' + notification.id).data('params', notification);
                        loadedNotifications.push(notification.id);
                    });

                    loadedcontent.notifications = loadedNotifications;

                    if (responce.data.count > ($('.notification-read').length - 1)) {
                        $('#notifications-show-more').removeClass('hide');
                    } else {
                        $('#notifications-show-more').addClass('hide');
                    }
                    if (typeof $.mCustomScrollbar !== 'undefined') {
                        $.mCustomScrollbar.defaults.theme = "minimal-dark"; //set "inset" as the default theme
                        $.mCustomScrollbar.defaults.scrollButtons.enable = true; //enable scrolling buttons by default

                        $(".outer,.nested").mCustomScrollbar({
                            mouseWheel: {preventDefault: true},
                            autoExpandScrollbar: true,
                            autoDraggerLength: true
                        });

                    }

                }

            }


        }
    });
    $('#notificationsWrapper').data(loadedcontent);
    return false;

}
function openReferPopup()
{
    $('#referTop').trigger('click');
}
function insertNotification(timestamp, notification) {
    $('li.notification-read').each(function () {
        var liElement = $(this);
        var elementTime = liElement.data('time');
        if (timestamp >= elementTime) {
            $(notification).insertBefore(liElement.closest('li.notification-read'));
            return false;
        }
    });
}


