    if (typeof $('#wscr_signup').bootstrapValidator !== 'undefined') {
        $('#wscr_signup').bootstrapValidator({
            excluded: [':disabled'],
            err: {
                container: function ($field, validator) {
                    if (validator.isValid()) {
                        $('.has-feedback').removeClass("has-error");
                    } else {
                        $('.has-feedback').addClass("has-error");
                    }
                }
            },
            fields: {
                'data[email]': {
                    trigger: 'blur',
                    validators: {
                        callback: {
                            callback: function (value, validator, $field) {
                                $('#wscr_email').val(value.trim());
                                return true;
                            }
                        },
                        notEmpty: {
                            message: 'Please enter a valid email address'
                        },
                        regexp: {
                            regexp: '^(([^<>()\\[\\]\\\\.,;:\\s@"]+(\\.[^<>()\\[\\]\\\\.,;:\\s@"]+)*)|(".+"))@((\\[[0-9]{1,3}\\.[0-9]{1,3}\\.[0-9]{1,3}\\.[0-9]{1,3}\\])|(([a-zA-Z\\-0-9]+\\.)+[a-zA-Z]{2,}))$',
                            message: 'Enter your valid email'
                        }
                    }
                },
                'data[phone_no]': {
                    trigger: 'blur',
                    validators: {
                        callback: {
                            callback: function (value, validator, $field) {
                                return validatePhoneBootStrap('wscr_tel');
                            }
                        },
                         notEmpty: {
                            message: 'Please enter a valid mobile number'
                        },
                    }
                }
            }
        }).on('success.form.bv', function (e) {

            // Prevent form submission
            e.preventDefault();
            var $form = $(e.target),
                    validator = $form.data('bootstrapValidator'),
                    submitButton = validator.getSubmitButton();
            if (validator.isValid()) {
                triggerTRGAEvent('Successful_Submission');
                signupUser($('#wscr_signup').serialize(),$("#wscr_signup").attr('action'),$(this));
            }
            return false;
            // Do whatever you want here ...
        }).on('error.field.bv', function (e, data) {
            $('.has-feedback').addClass("has-error");
            $('.has-error').find("input").addClass("loginerror");
            $('.has-success').removeClass("has-error");
            $('.has-error').find("input").removeClass("noerror");
            $('.has-success').find("input").removeClass("loginerror");
            if( (typeof $("#eu-terms-check-wscr").val() == "undefined" )
                    || $("#eu-terms-check-wscr").is(":checked")){
                data.bv.disableSubmitButtons(false);
            } else {
                data.bv.disableSubmitButtons(true);
            }
        }).on('success.field.bv', function (e, data) {
            $('.has-feedback').removeClass("has-error");
            $('.has-success').find("input").removeClass("loginerror");
            $('.has-success').find("input").addClass("noerror");
            $('.form-control').removeClass('loginerror');
            $('.form-group').removeClass("has-success");
            if( (typeof $("#eu-terms-check-wscr").val() == "undefined" )
                    || $("#eu-terms-check-wscr").is(":checked")){
                data.bv.disableSubmitButtons(false);
            } else {
                data.bv.disableSubmitButtons(true);
            }
        });

    }
