function validatePhoneBootStrap(inputPhoneId) {
    var telInput = $("#"+inputPhoneId);
    if (telInput.intlTelInput("isValidNumber")) {
        //var regex = /^[0-9-+]+$/;
        var regex = /^[0-9]+$/;
        if (regex.test(telInput.val())) {
            return true;
        } else {
            return {
                valid: false,
                message: 'Only numeric values are allowed.'
            };
        }
        //return true;
    } else {
        // For indian numbers
        if (
            /^[0-9]{1,10}$/.test(telInput.val())
            &&
            $("#mobile_country_code").val() == '+91'
            && telInput.val().length == 10
        ) {
            return {
                valid: true,
            };
        } else {
            return {
                valid: false,
                message: 'Please enter a valid mobile number.'
            };
        }
    }
}
