$(document).ready(function() {
    // Common method to set country code across all pages.
    var setCode = $("#mobile_country_code").val();
    var telInputMCC = $(".mobile_country_code");
    telInputMCC.intlTelInput({
       //initialCountry: setCode,
       preferredCountries: ['in', 'us'],
       separateDialCode: true
    });
    var charReg = /^[a-zA-Z ]+$/;
    if (charReg.test(setCode)) {
        telInputMCC.intlTelInput("setCountry", setCode);
    }
    var countrysel = telInputMCC.intlTelInput('getSelectedCountryData').dialCode;
    setTimeout(function(){
        $("#mobile_country_code").val("+"+ countrysel);
    }, 3000);
    telInputMCC.on("countrychange", function(e, countryData) {
        //var countrysel = $(".mobile_country_code").intlTelInput('getSelectedCountryData').dialCode;
        var countrysel = $(this).closest(".mobile_country_code").intlTelInput('getSelectedCountryData').dialCode;
        $("#mobile_country_code").val("+"+ countrysel);
        // @todo find its location
        $("#hiddenmobilecountrycodews").val("+"+ countrysel);
        $("#hiddenmobilecountrycode").val("+"+ countrysel);
    });
    setTimeout(function() {
        populateUserInfo();
    }, 2000);
});

