$(document).on("click", ".newlms-call-btn", function (e) {
    var event_Category = "";
    var event_action = "";
    var user_id = userinfo['id'];
    var timestamp = new Date($.now());
    var page_title = $(location).attr("href");
    var flag = false;
    var coursename = $.trim($(this).parents(".newlms-mycourse-block").find(".lms-title-mycourses").text());
    if ($(this).attr("href").indexOf("/my-course") >= 0) {

        event_Category = "Go To Course :- Button";

        event_action = "Go To Course :-" + coursename;
        flag = true;
    } else if ($(this).attr("href").indexOf("/communities") >= 0) {
        event_Category = "Go To Community";
        event_action = "Go To Community :-" + coursename;
        flag = true;
    }

    if (flag) {
        e.preventDefault();

        ga('send', 'event', event_Category, event_action, 'UserId:' + user_id + ', Date:' + timestamp + ',page title:' + page_title, 0);
        window.location.href = $(this).attr("href");
    }
});


