/**
 * @desc Fire GA Events Enroll Now (CLP and MLP)
 * author G Naresh
 * Date 2018-Oct-18
 * @param categoryName
 * @param eventAction
 * @param eventLabel
 */
var previousLocation = "NavBar"; 

function getLead(){    
    var email = getCookie("edu_user_email");     
    var leadType = "NoLead";
    if ( email != null && email != "" && email != "undefined" && typeof email != "undefined" ) {
        leadType = "Lead";
    }
    return leadType;
}

function fireEnrollNowGA(element, newCategory, newStatus, newAction, fieldName) {

    var finalAction;
    var finalCategory;
    var eventLabel;
    finalCategory = "EnrollFunnel";
    if (element !== null && element !== 'undefined') {
        localStorage.setItem("previousLocation", $(element).data('action'));
        previousLocation = localStorage.getItem("previousLocation");
        if ($(element).data('action') == 'Start Learning') {
            finalAction = "Clicked_On_Start_Learning_Certification";
        } else if ($(element).data('action') == 'Avail Offer') {
            finalAction = "Clicked_On_Avail_Offer_CLP";
            if (typeof page_name != 'undefined' && page_name == 'master_course_clp' ){
                finalAction = "Clicked_On_Avail_Offer_MLP";
            }
        } else {
            finalAction = "Clicked_On_Enroll_" + ($(element).data('action')).replace(" ", "_");
        }
    } else {
        previousLocation = localStorage.getItem("previousLocation");
        if (previousLocation == null || previousLocation == 'undefined' || previousLocation == 'Open Form') {
            previousLocation = "Navbar";
        }
        if (newAction == "PopupSubmit success") {
            finalAction = "Successful_Submission_EnrollPopUp";
            eventLabel = "Location: " + previousLocation.replace(" ", "_") + " ,";
        } else if (newStatus == "Error") {
            finalAction = "Error_Message_on_EnrollPopup_" + previousLocation.replace(" ", "_");
            eventLabel = "Location: " + previousLocation.replace(" ", "_") + " ,";
        } else {
            finalAction = newAction;
            eventLabel = "Location: " + previousLocation.replace(" ", "_") + " ,";
        }
    }
    var newLead = getLead();    
    eventLabel = ( (eventLabel != null && eventLabel != 'undefined') ? eventLabel : " ") + " Lead : " + newLead
                   + " , PageName : " + $(location).attr("href") + " ,TimeStamp : " + new Date($.now()) 
                   + " ,Country : " + track_country;
    //eventLabel =  newLead + ' , ' + $(location).attr("href")+ ' , ' + new Date($.now()) + " , " + track_country;
    if (typeof fieldName !== 'undefined' && fieldName !== 'undefined' && fieldName != null) {
        eventLabel = " ErrorFieldName : " + fieldName + ' , ' + eventLabel;
        //eventLabel = " " + fieldName + ' , ' + eventLabel;
    }
    
   
   ga('send', 'event',  finalCategory,   finalAction,  eventLabel, 0);  
   
   
}
   
