function getExpiryMessage(elemTarget) {
    if (!elemTarget.hasClass('requesting') && !elemTarget.hasClass('updated')) {
        $('.get-points-on-hover').addClass('requesting');
        $.ajax({
            url: '/api/1.0/referrals/referralexpiry',
            dataType: 'json',
            error: function () {
                $('.get-points-on-hover').removeClass('requesting');
            },
            success: function (response) {
                if (response.data.status == 200) {
                    var expMessage = '<i class="fa fa-exclamation-circle" aria-hidden="true"></i>';
                    if (typeof response.data.pointsdata != "undefined" && (response.data.pointsdata).length > 0) {
                        $.each(response.data.pointsdata, function (key, value) {
                            expMessage += value;
                        });
                        $('.expiring-points-message-refer').html(expMessage);
                    }
                    var clpMessage = '';
                    if (typeof response.data.clpdata != "undefined" && (response.data.clpdata).length > 0) {
                        $.each(response.data.clpdata, function (key, value) {
                            clpMessage += value;
                        });
                        $('.expirynotificationsec .notimsg').html('<i class="icon-Information3"></i><span class="notificationtxt">' + clpMessage + '</span>');
                    }
                }
                $('.get-points-on-hover').addClass('updated').removeClass('requesting');
            }
        });
    }
}
function getCopyLink(watsapp) {
    if (typeof watsapp == 'undefined')
        shareLink = 'copylink';
    else
        shareLink = 'watsapp';
    var jsonArray = {
        'medium': shareLink,
        'uid': referalVars.userid,
        'pagename': referalVars.pagename,
        'custPagename': referalVars.custPagename,
        'course_id': referalVars.course_id,
        'masterurl': referalVars.masterUrl
    };
    if ($('.refer-new-link').length == 0 && $('.refer-this.watsapp:visible').length == 0 && $('.refer-this.watsapp:visible'))
        return false;
    $.ajax({
        url: '/api/1.0/referrals/getshareurl',
        data: jsonArray,
        dataType: 'json',
        type: 'POST',
        error: function () {
            getCopyLink(shareLink);
        },
        success: function (response) {
            if (response.data.status == 200) {
                if (typeof watsapp == 'undefined') {
                    $('.refer-new-link').val(response.data.shorturl);
                    $('.refer-new-link').html(response.data.shorturl);
                } else {
                    $('.refer-this.watsapp').attr('href', response.data.sharepop);
                    if (navigator.userAgent.match(/iPhone|Android/i)) {
                        $('.refer-this.watsapp,.share-this.watsapp').removeClass('hide');
                    } else {
                        $('.refer-this.watsapp,.share-this.watsapp').addClass('hide');
                    }
                }

            }
        }
    });
}
function getActiveCredits() {
    if (typeof isloggedIn == 'undefined' || (typeof isloggedIn != 'undefined' && isloggedIn == ''))
        return false;
    $.ajax({
        url: '/api/1.0/referrals/getvalidcredits',
        dataType: 'json',
        type: 'GET',
        error: function () {
            getActiveCredits();
        },
        success: function (response) {
            if (response.status == 200) {
                if (typeof response.data.currency == 'string') {
                    var currency = response.data.currency;
                    ambassadorAmount = response.data.referral_amount;
                    if (typeof ambassadorAmount[currency] != 'undefined') {
                        var referralCurrencyArray = ambassadorAmount[currency];
                    }
                    if (typeof referralCurrencyArray != 'undefined') {
                        var existingcustomer = $("#existing_cust").val();
                        if (typeof referralCurrencyArray['referral_amount'] != 'undefined') {
                            var creditHtml = '<i class="fa fa-' + currency + '" aria-hidden="true"></i>' + referralCurrencyArray['referral_amount'];
                            $('.user-referral-amount').val(creditHtml);
                            if (existingcustomer != 0 || referralCurrencyArray['referral_amount'] > 0) {
                                $('.walleticonheader').show();
                                if (referralCurrencyArray['referral_amount'] > 0) {
                                    $('.redeembtn, .expiring-points-message-refer').removeClass('hide');
                                    $('.walleticonheader').addClass('get-points-on-hover');
                                } else {
                                    $('.redeembtn, .expiring-points-message-refer').addClass('hide');
                                    $('.walleticonheader').removeClass('get-points-on-hover');
                                }
                            }
                        }
                        if (typeof referralCurrencyArray['referral_amount_no_limit'] != 'undefined') {
                            var usableCreditHtml = '<i class="fa fa-' + currency + '" aria-hidden="true"></i>' + referralCurrencyArray['referral_amount_no_limit'];
                            $('.usable-referal').html(usableCreditHtml);
                            var price = referralCurrencyArray['referral_amount_no_limit'].toLocaleString();
                            var usableCreditHtml_format = '<i class="fa fa-' + currency + '" aria-hidden="true"></i> ' + price;
                            $('.usable-referal-format').html(usableCreditHtml_format);
                            if (existingcustomer != 0 || referralCurrencyArray['referral_amount'] > 0) {
                                $('.walleticonheader').show();
                                if (referralCurrencyArray['referral_amount_no_limit'] > 0) {
                                    $('.redeembtn, .expiring-points-message-refer').removeClass('hide');
                                    $('.walleticonheader').addClass('get-points-on-hover');
                                } else {
                                    $('.redeembtn, .expiring-points-message-refer').addClass('hide');
                                    $('.walleticonheader').removeClass('get-points-on-hover');
                                }
                            }
                            if(page_name === "master_course_clp") {
                                var currencyCode = currency;
                                var discountAmount = (typeof masterMainCoursePrice['discountAmount'] !== "undefined" 
                                    && masterMainCoursePrice['discountAmount'] != null) 
                                    ? masterMainCoursePrice['discountAmount'][currencyCode] : 0;
                                var currentDiscount = (typeof masterMainCoursePrice['currentDiscount'] !== "undefined" 
                                        && masterMainCoursePrice['currentDiscount'] != null) 
                                        ? masterMainCoursePrice['currentDiscount'][currencyCode] : 0;
                                var creditsRedeemed = 0;
                                if (typeof ambassadorAmount != 'undefined' && typeof ambassadorAmount[currencyCode] != 'undefined') {
                                    var referralCurrencyArray = ambassadorAmount[currencyCode];
                                    if (typeof referralCurrencyArray['referral_amount_no_limit'] != 'undefined') {
                                        var creditsRedeemed = Number(referralCurrencyArray['referral_amount_no_limit']);
                                    }
                                }
                                price = discountAmount + currentDiscount;
                                price = !emptyCheck(existingCustomer) ? price : price + creditsRedeemed;
                                price = formatPrice(price);
                                var currency_i = '<i class="fa fa-' + currencyCode + '" aria-hidden="true"></i> ';
                                $(".discountsOfferedPrice").html(currency_i + price);
                                if (!emptyCheck(existingCustomer) && !emptyCheck(masterMainCoursePrice['totalMaterCoursePrice']) && !emptyCheck(ambassadorAmount)) {
                                    for (var currency_amb in ambassadorAmount) {
                                        if (!emptyCheck(ambassadorAmount[currency_amb]['referral_amount_no_limit'])) {
                                            masterMainCoursePrice['totalMaterCoursePrice'][currency_amb] += Number(ambassadorAmount[currency_amb]['referral_amount_no_limit']);
                                        }
                                    }
                                    price = !emptyCheck(masterMainCoursePrice['totalMaterCoursePrice']) ? masterMainCoursePrice['totalMaterCoursePrice'][currencyCode] : 0;
                                    price = formatPrice(price);
                                    $(".change_final_price").html(currency_i + price);   
                                }
                            }
                        }
                    }
                }
            }
        }
    });
}
