function emptyCheck(e) {
    switch (e) {
        case "":
        case null:
        case typeof this == "undefined":
            return true;
        default:
            if (!e) {
                return true;
            }
            return false;
    }
}

function cleanData(data) {
    for (var key in data) {
        if (emptyCheck(data[key])) {
            delete data[key];
        }
    }
    return data;
}

function triggerEvent(eventName, partialData) {
    if (partialData.hasOwnProperty('buttonId')) {
        partialData['buttonId'] = page_name + ";" + partialData['buttonId'];
        var buttonSplittedData = partialData['buttonId'].split(";");
        buttonSplittedData.forEach(function(element,index,array) {
           array[index] = "(" + element + ")";
        });
        partialData['buttonId'] = buttonSplittedData.join('-');
    }
    var finalData = $.extend({}, getBaseMetadata(), partialData);
    var cleanedData = cleanData(finalData);
    trackEvent(eventName, cleanedData);
    pushingProfileData(cleanedData);
}

function pushingProfileData(data) {
    var profileData = {};
    var email = getCookie("edu_user_email");
    var phone = getCookie("edu_user_phone");
    var country_code = getCookie("edu_user_country_code");
    if (emptyCheck(country_code)) {
        country_code = $("#mobile_country_code").val();
        country_code = emptyCheck(country_code) ? "+91" : country_code;
    }
    if (!emptyCheck(email)) {
        profileData['Email'] = email;
    }
    if (!emptyCheck(data['email'])) {
        profileData['Email'] = data['email'];
    }
    if (!emptyCheck(data['userEmail'])) {
        profileData['Email'] = data['userEmail'];
    }
    if (!emptyCheck(phone)) {
        profileData['Phone'] = country_code + phone;
    }
    if (!emptyCheck(data['mobile'])) {
        profileData['Phone'] = country_code + data['mobile'];
    }
    if (!emptyCheck(data['userMobile'])) {
        profileData['Phone'] = data['userMobile'];
    }
    if (!emptyCheck(data['userId'])) {
        profileData['Identity'] = data['userId'];
    }
    if (!emptyCheck(userName)) {
        profileData['Name'] = userName;
    }
    pushProperties(cleanData(profileData));
}

