function logMLPEnroll() {
    var partialData = {};
    currentCurrency = getCurrency();
    var courseid = $('.enroll-clp-btn').attr('data-courseid');
    if (typeof courseid == "undefined" && courseid == null) {
        courseid = $('.enroll-clp-btn-user').attr('data-courseid');
    }
    $.extend(partialData, {               
        courseId : Number(courseid),
        courseName : coursesData[Number(courseid)].display_title.trim(),
        courseCategory : coursesData[Number(courseid)].Category.trim(),
        currency: currentCurrency,
        buttonId: "MLP;Enrollnow"
    });
    var courseDiscount = 0;
    var coursePrice = 0;
    if ( typeof(masterMainCoursePrice) != "undefind" && 
            !(jQuery.isEmptyObject(masterMainCoursePrice)) ){
        courseDiscount = Number(masterMainCoursePrice['total'][currentCurrency.toLowerCase()]);
        coursePrice = courseDiscount + Number(masterMainCoursePrice['totalMaterCoursePrice'][currentCurrency.toLowerCase()]);
    }
    if (coursePrice != 0) {
        $.extend(partialData, {
            coursePrice : coursePrice,
            courseDiscountPrice : coursePrice - courseDiscount
        });
    }
    if (currentButtonLocation) {
        $.extend(partialData, {
            currentScreenModule: currentButtonLocation
        });
    }
    if (!emptyCheck(mlpBatches)) {
        $.extend(partialData, {
            batchesAvailable: Number(mlpBatches)
        });
    }
    if (mlpBatchStartDate) {
        $.extend(partialData, {
            startDate: new Date(mlpBatchStartDate)
        });
    }
    return partialData;
}

function logAllCoursesEnroll() {
    var partialData = {};
    var detailsid = detailsIdForEnrollNowEvent(ctAllcourseEnrollCourseId);
    currentCurrency = getCurrency();
    var coursePrice, discountPrice, finalStartDate, batchAvailable, courseDiscountPrice;
    coursePrice = courseDiscountPrice = discountPrice = finalStartDate = batchAvailable = 0;
    $.extend(partialData,{                           
        courseId : Number(ctAllcourseEnrollCourseId),
        courseTitle : coursesData[ctAllcourseEnrollCourseId].display_title,  
        courseCategory:coursesData[ctAllcourseEnrollCourseId].Category,
        currency: currentCurrency,
        buttonId: "AllCourses;EnrollNow"
        
    });
    if (typeof(courseData['course_details'][detailsid]['Course']["Batch"][0][0]) !== 'undefined' ) {
        var day = $(courseData['course_details'][detailsid]["Course"].Batch[0][0]['start_date']).text().trim();
        var todayDate = new Date();
        finalStartDate = new Date(todayDate.getFullYear(), todayDate.getMonth(), Number(day) + 1);
        batchAvailable = courseData['course_details'][detailsid]["Course"].Batch.length;
        coursePrice = courseData['course_details'][detailsid]['Course']["Batch"][0][0]["batch_price_array"]['price_'+currentCurrency.toLowerCase()];
        discountPrice = courseData['course_details'][detailsid]['Course']["Batch"][0][0]["batch_price_array"]['price_discount_'+currentCurrency.toLowerCase()];
        if (discountPrice) {
            courseDiscountPrice = discountPrice;
        } else {
            courseDiscountPrice = coursePrice;
         }
        $.extend(partialData, {
            startDate: finalStartDate,
            batchesAvailable: batchAvailable,
            coursePrice: Number(coursePrice),
            courseDiscountPrice: Number(courseDiscountPrice)
        });
    }
    return partialData;
}

