function resetForms(clickedEleRef) {
    $(".inputfld").removeClass("error");
    $(".errormsg_vd").text("");
    $(".control_place").removeClass("error");
    $(".response_error").html("");
}

function focusTheActiveField() {
    switch(active_window) {
        case SIGNUP:
            if (currentStage == STAGE_SIGNUP) {
                $('.signup-new-form').find('#sg_popup_email').focus();
                $('.signup-new-form').find('#sg_popup_email').attr("placeholder", "e.g. zoe@gmail.com");
            } else {
                $('.signup-passwd-division').find('.pwd2_new').focus();
            }
            break;
        case LOGIN:
            $('.sigin-new-division').find('#si_popup_email').focus();
            $('.sigin-new-division').find('#si_popup_email').attr("placeholder", "e.g. zoe@gmail.com");
            break;
        case VERIFY_CODE:
            $('.signin-new-verifycode-div').find('#forgot_email_new').focus();
            $('.signin-new-verifycode-div').find('#forgot_email_new').attr("placeholder", "e.g. zoe@gmail.com");
            break;
        case RESET_CODE:
            $('.signin-new-reset-div').find('#otpfield_new').focus();
            $('.signin-new-reset-div').find('#otpfield_new').attr("placeholder", "Enter the verification code");
            break;
    }
}

