    $('.signup-new-icon').show();
    $('.signup-new-title').html(LABEL_LOGIN_SIGNUP);
    resetForms($('.silent-signup-division'));
    $('.signin-new-verifycode-div').hide();
    $('.signin-new-reset-div').hide();
    $('.sigin-new-division').hide();
