function validateField(thisElement, parentClass, regexString, errorClass, errorField, fieldName) {
    var fieldValue = thisElement.val().trim();
    thisElement.val(fieldValue)
    var parentElement = thisElement.closest("." + parentClass);
    if (fieldValue) {
        var regex = new RegExp(regexString);
        if (regex.test(fieldValue)) {
            parentElement.removeClass(errorClass);
            parentElement.find(errorField).text("");
            return true;
        } else {
            parentElement.addClass(errorClass);
            if (fieldName === "password") {
                parentElement.find(errorField).text("Password should be minimum of 8 characters");
            } else {
                parentElement.find(errorField).text("Enter a valid " + fieldName);
            }
            return false;
        }
    } else {
        parentElement.addClass(errorClass);
        parentElement.find(errorField).text("Enter " + fieldName);
        return false;
    }
}

