function myRedirect(redirectUrl , response) {
    var downloadurl = null;
    var temp_redirectUrl = redirectUrl;
    var classrecording = false;
    var thankyou = false;
    var downloadonrefresh = false;
    if (redirectUrl.toLowerCase().indexOf("class-recording") >= 0) {
        classrecording = true;
        redirectUrl = redirectUrl.replace('-class-recording', '');
    }
    if (redirectUrl.toLowerCase().indexOf("thankyou") >= 0) {
        thankyou = true;
        redirectUrl = redirectUrl.replace('-thankyou', '');
    }

    if (typeof response !== "undefined" && ( response.status == "lead" ||response.lead == "lead" )) {
        thankyou = true;
    }

    if (redirectUrl.toLowerCase().indexOf("download_curriculum") >= 0) {
        $('#ajax-loader').hide();
        $("#guest_video").modal("hide");
        var currentURL = window.location.href;

        downloadurl = redirectUrl;
        redirectUrl = currentURL;
        downloadonrefresh = true;
    }
    redirectUrl = $.trim(redirectUrl);
     if (typeof response !== "undefined" && typeof response.course_city !== "undefined"  && response.course_city != "" ) {
        redirectUrl = response.course_city;
    }
    if (classrecording || thankyou || downloadonrefresh) {
        var form = $('<form action="' + redirectUrl + '" method="post">' +
                '<input type="hidden" name="' + "class-recording" + '" value="' + classrecording + '"></input>' +
                '<input type="hidden" name="' + "downloadurl_Pdf" + '" value="' + downloadurl + '"></input>' +
                '<input type="hidden" name="' + "thankyou" + '" value="' + thankyou + '"></input>' + '</form>');
        $('body').append(form);
        $(form).submit();
    } else {
        window.location.href = temp_redirectUrl;
    }
};



