// Exit intent
function addEvent(obj, evt, fn) {
    if (obj.addEventListener) {
        obj.addEventListener(evt, fn, false);
    }
    else if (obj.attachEvent) {
        obj.attachEvent("on" + evt, fn);
    }
}

// Exit intent trigger
addEvent(document, 'mouseout', function(evt) {
    var email = getCookie("edu_user_email");
    if ( email != null && email != "" && email != "undefined" && typeof email != "undefined" ) {
        return;
    }
    if (evt.toElement == null && evt.relatedTarget == null && !isgetExitPopDataRunning) {
        if (enableOL && isOfferRunning && localStorage.getItem("exitintent_popup_show") == null) {
            $('#exitpop_mode').modal('show');
            localStorage.setItem("exitintent_popup_show", 1);// Set the flag in localStorage
        } 
        if (enableEI && localStorage.getItem("exitintent_popup_show") == null && is2MinsPassed()) {
            $('#exitpop_mode_all').modal('show');         
            localStorage.setItem("exitintent_popup_show", 1); // Set the flag in localStorage
            fireGAforExitIntentPopup("Exit_Intent_PopUp", "PopUp_Shown", "PageName : " + $(location).attr("href"));
        }
    }    
});

