/*
 * @desc: Slide Toggle Function for Contact Us CLP Widget Starts
 * @created: 5th July, 2018
 * @author: Mrigendra Kr <mrigendra.kumar@edureka.co>
 */

	$('.widget-contactus-btn').click(function (e) {
		e.preventDefault();
		if(contactUsWidgetOpen){
            toggleContactUsWidget('hide');
        }
        else{
            toggleContactUsWidget('show');
        }
	});

	$('.widget-contactus-close').click(function (e) {
        e.preventDefault();
		createCookie("widgetContactUsManuallyCLosed", "yes")
    });

	// function to toggle hide show of contactus widget
	function toggleContactUsWidget(action) {

		if(action == 'show'){
            contactUsWidgetOpen = true;
			$("#widget-contactus-btn").css('display', 'none');

			$('.widget-contactus-clp').css('z-index', 3);
			$('#widget-contactus-content').animate({
				right: '155px'
			});
		}
		else{
            contactUsWidgetOpen = false;
            $("#widget-contactus-btn").css('display', 'block');

			$('#widget-contactus-content').animate({
				right: '-375px'
			}, function () {
				$('.widget-contactus-clp').css('z-index', 1);
			});
		}

	}

	/**
	 *	Contact widget auto-popup. Opens after 10 seconds.
	 */
        
        function setTimerForContactUs() {
            if (typeof iscustomerGA != "undefined" && iscustomerGA == "false") {
		var contactWidgetShowTime = 10000;
		var contactWidgetHideTime = 40000;
                var contactWidgetanuallyClosed = readCookie("widgetContactUsManuallyCLosed");
                if (contactWidgetanuallyClosed != 'yes' && $(window).width() > 640) {
                    //auto show contact us widget
                    setTimeout(function () {
                        toggleContactUsWidget('show');
                    }, contactWidgetShowTime);
                    //auto hide contact us widget
                    setTimeout(function () {
                        toggleContactUsWidget('hide');
                    }, contactWidgetHideTime);
                }
            }
        }

