$('#category_inquiry').bootstrapValidator({
    excluded: [':disabled'],
    err: {
        container: function ($field, validator) {

            if (validator.isValid()) {
                $('.has-feedback').removeClass("has-error");
                $('.form-control').removeClass("loginerror");
            } else {
                $('.has-feedback').addClass("has-error");
                $('.form-control').removeClass("loginerror");
            }
        }
    },
    fields: {
        'data[Feedback][first_name]': {
            trigger: 'blur',
            validators: {
                notEmpty: {
                    message: 'First Name is required.'
                },
                regexp: {
                    regexp: '^[a-zA-Z][a-zA-Z\\s]+$',
                    message: 'Name is required.'
                },
                stringLength: {
                    max: 50,
                    message: 'The First name must be less than 50 characters long'
                }
            }
        },

        'data[Feedback][email]': {
            trigger: 'blur',
            validators: {
                notEmpty: {
                    message: 'Email is required'
                },
                regexp: {
                    regexp: '^[^@\\s]+@([^@\\s]+\\.)+[^@\\s]{2,4}$',
                    message: 'The value is not a valid email address'
                }
            }
        },
        'data[Feedback][phone_no]': {
            trigger: 'blur',
            validators: {
                notEmpty: {
                    message: 'Mobile Number is required',
                },
                regexp: {
                    regexp: '^[0-9-+]+$',
                    message: 'The value is not a valid mobile number'
                }
            }
        },
        'data[Feedback][query]': {
            trigger: 'blur',
            validators: {
                notEmpty: {
                    message: 'The query is required and cannot be empty'
                },
                stringLength: {
                    min: 10,
                    message: 'The query must have 10 characters long'
                },
            }
        },

    }
}).on('success.form.bv', function (e) {
    // Prevent form submission
    e.preventDefault();
    var $form = $(e.target),
        validator = $form.data('bootstrapValidator'),
        submitButton = validator.getSubmitButton();
    if (validator.isValid()) {
        $('#ajax-loader').show();
        $.ajax({
            url: webURL + 'pages/feedback',
            data: $("#category_inquiry").serialize(),
            type: 'POST',
            dataType: 'json',
            error: function () {
                $('#ajax-loader').hide();
            },
            success: function (data) {
                $('#ajax-loader').hide();

                if (data.status == "thankyou" || data.status == "lead" || data.status == "success") {
                    if (data.status == "thankyou" || data.status == "lead") {
                        $('#load_conversion_code').load(webURL + 'contents/load_conversion_code/na');
                    }
                    event_category = "User Inquiry submitted";
                    var message = "Thanks for submitting your query";
                    $("#category_page_inquiry").val("");
                } else if (data.status == "failed") {
                    event_category = "User Inquiry Failed";
                    var message = "Inquiry Failed";
                } else if (data.status == 'error') {
                    var message = "Inquiry Failed";
                }
                $("#thanksmsg-form-bot-cat").text(message);
                $("#thanksmsg-form-bot-cat").show();
                //  Hide the thank you mockup after 5 seconds
                setTimeout(function () {
                    $("#thanksmsg-form-bot-cat").hide()
                }, 5000);

                $('#category_inquiry').bootstrapValidator('resetForm', true);
            }
        });
    }
    return false;
    // Do whatever you want here ...
}).on('error.field.bv', function (e, data) {
    $('.has-feedback').addClass("has-error");
    $('.has-error').find("input").addClass("loginerror");
    $('.has-success').removeClass("has-error");
    $('.has-error').find("input").removeClass("noerror");
    $('.has-success').find("input").removeClass("loginerror");
    data.bv.disableSubmitButtons(false);
}).on('success.field.bv', function (e, data) {
    $('.has-feedback').removeClass("has-error");
    $('.has-success').find("input").removeClass("loginerror");
    $('.has-success').find("input").addClass("noerror");
    $('.form-control').removeClass('loginerror');
    $('.form-group').removeClass("has-success");
    data.bv.disableSubmitButtons(false);
});
