$(document).ready(function () {
    // Configure/customize these variables.
    var showChar = 180;  // How many characters are shown by default
    var ellipsestext = "...";
    var moretext = "Show more";
    var lesstext = "Show less";

    var windowWidth = $(window).width();
    if (windowWidth <= 767) {
        $('.more').each(function () {
            var content = $(this).html();

            if (content.length > showChar) {

                var c = content.substr(0, showChar);
                var h = content.substr(showChar, content.length - showChar);

                var html = c + '<span class="moreellipses">' + ellipsestext + '&nbsp;</span><span class="morecontent"><span>' + h + '</span>&nbsp;&nbsp;<a href="" class="morelink">' + moretext + '</a></span>';

                $(this).html(html);
            }

        });

        $(".morelink").click(function () {
            if ($(this).hasClass("less")) {
                $(this).removeClass("less");
                $(this).html(moretext);
            } else {
                $(this).addClass("less");
                $(this).html(lesstext);
            }
            $(this).parent().prev().toggle();
            $(this).prev().toggle();
            return false;
        });
    }

    $('.giTrackElementClpV2').click(function () { trackGIEventClpV2(this); return true; });

});

function trackGIEventClpV2(element) {
    eventCategory = 'Category Landing page';
    //has a custom override category been set on the element?.. checking...
    eventCategoryOverride = $(element).data('gi-category');
    if (eventCategoryOverride !== '' && eventCategoryOverride != undefined) {
        eventCategory = eventCategoryOverride;
    }

    eventAction = $(element).data('gi-action');
    eventLabel = $(element).data('gi-label');

    //handling the default
    if (eventLabel == undefined || eventLabel == 'default') {
        eventLabel = '';
    }

    expandLabel = $(element).data('gi-label-expanded');
    if (expandLabel == true || expandLabel == 'true') {
        //let us expand the label as "<label value>;UserEmail; timestamp; page title"
        //handling the delimiter case
        if (eventLabel != '') {
            eventLabel = eventLabel + ';';
        }
        //now expanding/augmenting the label value
        eventLabel = eventLabel + userEmail + ';' + Date().toString() + ';' + document.title;
    }

    reportGAEvent(eventCategory, eventAction, eventLabel);
    return true;
}

var autocollapse = function () {

    var tabs = $('#tabscat');
    var tabsHeight = tabs.innerHeight();

    if (tabsHeight >= 70) {
        while (tabsHeight > 70) {
            //console.log("new"+tabsHeight);

            var children = tabs.children('li:not(:last-child)');
            var count = children.size();
            $(children[count - 1]).prependTo('#collapsed');

            tabsHeight = tabs.innerHeight();
        }
    }
    else {
        while (tabsHeight < 70 && (tabs.children('li').size() > 0)) {

            var collapsed = $('#collapsed').children('li');
            var count = collapsed.size();
            $(collapsed[0]).insertBefore(tabs.children('li:last-child'));
            tabsHeight = tabs.innerHeight();
        }
        if (tabsHeight > 70) { // double chk height again
            autocollapse();
        }
    }

};

$(document).ready(function () {

    autocollapse(); // when document first loads

    $(window).on('resize', autocollapse); // when window is resized

});


